import React from 'react';
import ReactDOM from 'react-dom/client';
import logo from './logo.svg';
import './App.css';

class Header extends React.Component {
  constructor(props){
    super(props);
  }
  render () {
    return (
    <div className="Header">
      <logo />
      <div>
        <li>Home</li>
        <li>Products</li>
        <li>Company</li>
      </div>
    </div>
    );
  }
}

class App extends React.Component {
  constructor(props){
    super(props);
  }
  render () {
    return (
    <div className="App">
      <Header />
    </div>
    );
  }
}

export default App;
